import React from 'react';
import RemoveIcon from '@material-ui/icons/Remove';
import Button from '@material-ui/core/Button';

function List(props) {
    return (
        <li>
            <Button
                onClick={() => {
                    props.delFunc(props.id)
                }
                }
            > <RemoveIcon />
            </Button>
            {props.notes}
        </li>
    );
}

export default List;
